import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Link, Switch } from "react-router-dom";
import { withRouter, useLocation } from "react-router";
import { createBrowserHistory } from "history";

import './App.scss';
import Works from './Works';
import StudyOne from './StudyOne';
import StudyTwo from './StudyTwo';
import Navbar from './Navbar';
import LeftContainer from './LeftContainer';

// import logo from './logo.svg';
// img src={logo}
const history = createBrowserHistory();

class App extends Component {
	constructor(props) {
	    super(props);
	    this.state = { wordValue: "Designer", currentCount: 10 };
	}
	componentDidMount() {

	}

	render() {
		return (
			<div className="portfolioContainer">
			    <div className="rightContainer">
		    		<Router history={ history }>
		    			<Switch>
		    				<Route exact path="/works" component={ Works } history={ history } />
		    				<Route exact path="/works/one" component={ StudyOne } />
		    				<Route exact path="/works/two" component={ StudyTwo } />
		    				<Route exact path="/about" component={ About } />
		    			</Switch>
			    		<Navbar history={ history } set={ Settings } />
			    	</Router>	
			    </div>
			</div>
		)
	}
}

export default App;

const Settings = () => {
    let location = useLocation();
};


function About() {
  return (
    <div>
      <h2>About</h2>
    </div>
  );
}
